00491         const base_t& assign(base_t& larg,Int_Type arg) noexcept {
00492                 using type_traits::maxbase;
00493                 constexpr sint128_t B_128t_v{static_cast<sint128_t>(B)};
00494                 constexpr bool puede_multiplicarse{
00495                                 (maxbase<sint128_t>()/B_128t_v) > 0
00496                 };
00497                 if ((&larg)!=(&arg)) {
00498                         sint128_t creg_g{static_cast<sint128_t>(arg)};
00499                         sint128_t BasePowIx{B_128t_v};
00500                         for(size_t k{1u} ; k < L ; ++k) {
00501                                 if constexpr (puede_multiplicarse)
00502                                         BasePowIx *= B_128t_v;
00503                                 else
00504                                         break;
00505                         }
00506                         while (creg_g < 0) {
00507                                 creg_g += BasePowIx;
00508                         }
00509                         for(size_t k{0u} ; k < L ; ++k){
00510                                 larg[k] = dig_t(creg_g%B_128t_v);
00511                                 creg_g /= B_128t_v;
00512                         }
00513                 }
00514                 return (larg);
