00532                                                                                                                 type_traits::ge_sz_v<
00533                                                                                                                                 UINT_T,
00534                                                                                                                                 Int_Type
00535                                                                                                                 >,
00536                                                                                                                         UINT_T,
00537                                                                                                                         Int_Type
00538                                                                                                         >
00539                                                                                         >;
00540                 UInt_Type argc = static_cast<UInt_Type>((arg<0)?-arg:arg);
00541                 constexpr UInt_Type Bc = static_cast<UInt_Type>(B);
00542 
00543                 size_t ix{0};
00544                 UInt_Type quotient = argc / Bc;
00545                 UInt_Type remainder = argc % Bc;
00546                 do {
00547                         by_index(ix) = remainder;
00548 
