00550                         quotient = argc / Bc;
00551                         remainder = argc % Bc;
00552 
00553                         ++ix;
00554                 } while( argc != 0 );
00555 
00556                 if (ix < L-1)
00557                         for( ; ix < L ; ++ix)
00558                                 by_index(ix) = dig_t::dig_0();
