00699         template<bool with_result_type>
00700         static constexpr inline
00701         auto    preincrement (base_t& arg)  noexcept ->
00702                         std::conditional_t<
00703                                         with_result_type,
00704                                                 res_base_op_t<binop_e::add>,
00705                                                 const base_t &
00706                         >
00707         {
00708                 if constexpr (with_result_type) { 
00710                         res_base_op_t<binop_e::add> ret{
00711                                 .result_content_low = static_cast<base_t>(arg),
00712                                 .carry                                                  =       dig_t::dig_0(),
00713                                 .good_result                            =       true
00714                         };
00716                         dig_t& carry{ret.carry};
00718                         auto&  result{ret.result_content_low};
00720                         bool&  good{ret.good_result};
00722                         if (arg[0].is_Bm1()) {
00723                                 result[0] = dig_t::dig_0();
00724                                 carry           = dig_t::dig_1();
00725                         }
00726                         else {
00727                                 ++result[0];
00728                                 carry   = dig_t::dig_0();
00729                                 return ret;
00730                         }
00732                         if (carry.is_not_0()) {
00733                                 for(size_t ix{1} ; ix < L ; ++ix) {
00734                                         if (carry.is_not_0()) {
00735                                                 if (arg[ix] == dig_t::dig_Bm1()) {
00736                                                         result[ix] = dig_t::dig_0();
00737                                                         carry = dig_t::dig_1();
00738                                                         continue;
00739                                                 }
00740                                                 else {
00741                                                         ++result[ix];
00742                                                         carry = dig_t::dig_0();
00743                                                         return ret;
00744                                                 }
00745                                         }
00746                                 }
00747                         }
00748                         if (carry.is_not_0()) {
00749                                 good = false;
00750                         }
00751                         return ret;
00752                 }
00753                 else {
00755                         dig_t carry{dig_t::dig_0()};
00757                         if (arg[0].is_Bm1()) {
00758                                 arg[0] = dig_t::dig_0();
00759                                 carry = dig_t::dig_1();
00760                         }
00761                         else {
00762                                 ++arg[0];
00763                                 return (arg);
00764                         }
00766                         for(size_t ix{1} ; ix < L ; ++ix) {
00767                                 if (carry.is_1()) {
00768                                         if (arg[ix].is_Bm1()) {
00769                                                 arg[ix]         = dig_t::dig_0();
00770                                                 carry           = dig_t::dig_1();
00771                                                 continue;
00772                                         }
00773                                         else {
00774                                                 ++arg[ix];
00775                                                 return (arg);
00776                                         }
00777                                 }
00778                         }
00779                         return (arg);
00780                 }
00781         }
