00849                                         if (arg[ix].is_not_0()) {
00850                                                 --arg[ix];
00851                                                 return (arg);
00852                                         }
00853                                         else if (arg[ix].is_0()) {
00854                                                 arg[ix] = dig_t::dig_Bm1();
00855                                                 borrow = dig_t::dig_1();
00856                                         }
00857                                 }
00858                         }
00859                         return (arg);
00860                 }
00861                 else {
00863                         res_base_op_t<binop_e::sub> ret{
00864                                 .result_content_low     =       arg,
00865                                 .borrow                                                 =       dig_t::dig_0(),
00866                                 .good_result                            =       true
00867                         };
00869                         auto& result{ret.result_content_low};
00871                         dig_t& borrow{ret.borrow};
00873                         bool& good{ret.good_result};
00875                         if (arg[0].is_not_0()) {
00876                                 --result[0];
00877                                 borrow          = dig_t::dig_0();
00878                                 return std::move(ret);
00879                         } else {
00880                                 result[0] = dig_t::dig_Bm1();
00881                                 borrow          = dig_t::dig_1();
00882                         }
00885                         for(size_t ix{1} ; ix < L ; ++ix) {
00886                                 if (borrow.is_not_0()) {
00887                                         if (arg[ix].is_not_0()) {
00888                                                 --result[ix];
00889                                                 borrow = dig_t::dig_0();
00890                                                 return std::move(ret);
00891                                         }
00892                                         else {
00893                                                 result[ix] = dig_t::dig_Bm1();
00894                                                 borrow = dig_t::dig_1();
00895                                                 continue;
00896                                         }
00897                                 }
00898                         }
00899                         if (borrow.is_not_0()) {
00900                                 good = false;
00901                         }
00902                         return std::move(ret);
00903                 }
