01145                                         /*                                                                                                                              */
01146                                         /*  ARITMETICOS CON ASIGNACION                  */
01147                                         /*              nat_reg_digs_t @= dig_t                         */
01148                                         /*                                  */
01149                                         /************************************/
01150 
01155         template<bool with_result_type>
01156         static constexpr inline
01157         auto m_add (base_t & larg,const dig_t & rarg) noexcept ->
01158                 typename std::conditional_t<
01159                         with_result_type,
01160                                 res_base_op_t<binop_e::add>,
01161                                 base_t
01162                 >
01163         {
01164                 using namespace type_traits;
01165                 constexpr UINT_T middle_max{std::numeric_limits<UINT_T>::max()/2};
01166                 using SIG_UINT_T = sig_UInt_for_UInt_t<UINT_T>;
01167                 using uint_type = std::conditional_t<B<=middle_max,UINT_T,SIG_UINT_T>;
01168                 using dig_t = typename NumRepr::dig_t<uint_type,B>::dig_t;
01169                 if constexpr (! with_result_type) {
01171                         dig_t carry{dig_t::dig_0()};
01173                         if (larg[0] <= dig_t::dig_Bm1()-rarg) {
01174                                 larg[0] += rarg;
01175                                 return (larg);
01176                         }
01177                         else {
01178                                 larg[0] -= (dig_t::dig_Bm1()-rarg+1);
01179                                 carry = dig_t::dig_1();
01180                         }
01182                         for(size_t ix{1} ; ix < L ; ++ix) {
01183                                 if (carry.is_1()) {
01184                                         if (larg[ix].is_Bm1()) {
01185                                                 larg[ix] = dig_t::dig_0();
01186                                                 carry = dig_t::dig_1();
01187                                         }
01188                                         else {
01189                                                 ++larg[ix];
01190                                                 return (larg);
01191                                         }
01192                                 }
01193                         }
01194                         return (larg);
01195                 }
01196                 else {
01198                         res_base_op_t<binop_e::add> ret{
01199                                 .result_content_low             =               larg,
01200                                 .carry                                                          =               dig_t::dig_0(),
01201                                 .good_result                                    =               true
01202                         };
01204                         auto&           result{ret.result_content_low};
01206                         dig_t&  carry{ret.carry};
01208                         bool&           good{ret.good_result};
01210                         if (larg[0] <= dig_t::dig_Bm1()-rarg) {
01211                                 result[0]       +=      rarg;
01212                                 carry                                            =      dig_t::dig_0();
01213                                 return std::move(ret);
01214                         }
01215                         else {
01216                                 ret.result_content[0]   -= (dig_t::dig_Bm1()+dig_t::dig_1()-rarg);
01217                                 carry                    = dig_t::dig_1();
01218                         }
01220                         for(size_t ix{1} ; ix < L ; ++ix) {
01221                                 if (carry.is_not_0()) {
01222                                         if (result[ix].is_Bm1()) {
01223                                                 result[ix]  = dig_t::dig_0();
01224                                                 carry       = dig_t::dig_1();
01225                                         }
01226                                         else {
01227                                                 ++result[ix];
01228                                                 carry = dig_t::dig_0();
01229                                         }
01230                                 }
01231                         }
01232                         if (carry.is_not_0())
01233                                 good = false;
01234                         return std::move(ret);
01235                 }
01236         }
01237 
01239         static constexpr inline
01240         const base_t & m_sub(base_t & larg,const dig_t & rarg) noexcept
01241         {
01243                 dig_t cprarg{rarg};
01245                 dig_t borrow{dig_t::dig_0()};
01247                 if (larg[0] >= rarg) {
01248                         larg[0] -= rarg;
01249                         borrow = dig_t::dig_0();
01250                         return (larg);
01251                 }
01252                 else {
01253                         cprarg -= larg[0];
01254                         larg[0] = cprarg.C_B();
01255                         borrow  = dig_t::dig_1();
01256                 }
01258                 for(size_t ix{1} ; ix < L ; ++ix) {
01259                         if (borrow.is_1()) {
01260                                 if (larg[ix].is_0()) {
01261                                         larg[ix] = dig_t::dig_Bm1();
01262                                         borrow  = dig_t::dig_1();
01263                                         continue;
01264                                 }
01265                                 else {
01266                                         --larg[ix];
01267                                         borrow = dig_t::dig_0();
01268                                         return (larg);
01269                                 }
01270                         }
01271                 }
01272                 return (larg);
01273         }
