01319         template<bool with_result_type>
01320         constexpr inline
01321         auto mult(dig_t arg) const noexcept ->
01322                 std::conditional_t<
01323                         with_result_type,
01324                                 res_base_op_t<binop_e::mult>,
01325                                 const base_t &
01326                 >
01327         {
01328                 nat_reg_digs_t cpthis(*this);
01329                 if constexpr (with_result_type) {
01330                         res_base_op_t<binop_e::mult> ret{
01331                                 .result_content_low     = base_const_ref_cthis(),
01332                                 .result_content_high    = regd_0(),
01333                                 .good_result                                    = true
01334                         };
01335                         base_t & res_low {ret.result_content_low };
01336                         base_t & res_high{ret.result_content_high};
01337                         bool   & good{ret.good_result};
01338                         if (arg.is_0()) {
01339                                 res_low         = regd_0();
01340                                 return std::move(ret);
01341                         }
01342                         else if (nat_reg_digs_t::is_0()) {
01343                                 return std::move(ret);
01344                         }
01345                         else if (arg.is_1()) {
01346                                 return std::move(ret);
01347                         }
01348                         else if (nat_reg_digs_t::is_1()) {
01349                                 res_low.set_0();
01350                                 res_low[0] = arg;
01351                                 return std::move(ret);
01352                         }
01353                         else {
01354                                 constexpr UINT_T sqrt_max{type_traits::sqrt_max<UINT_T>()};
01355                                 using uint_type = std::conditional_t<
01356                                         B <= sqrt_max ,
01357                                                 UINT_T,
01358                                                 SIG_UINT_T
01359                                 >;
01360                                 constexpr uint_type Bc{B};
01361                                 uint_type carry{0};
01362                                 uint_type cparg{arg()};
01363                                 for(size_t ix{0} ; ix < L ; ++ix){
01364                                         uint_type digint{const_by_index(ix)};
01365                                         digint *= cparg;
