01776         template<type_traits::uint_type_for_radix_c Int_Type,
01777                                         Int_Type Base,
01778                                         size_t Length>
01779                 requires (type_traits::suitable_base<Int_Type,Base>()&&(Length > 0))
01780         std::istream &
01781         operator >> (std::istream & is,nat_reg_digs_t<Int_Type,Base,Length> & arg) {
01782                 enum estado_e {
01783                         e0ini   , e1r           , e1e           , e1g                   , e1sep         ,
01784                         e1d             , e1i           , e2g           , e2start       , e2dig         ,
01785                         e2dp    , e2end , e2B           , e3dig         , e0fin
01786                 };
01788                 std::string sds;
01790                 using inttype = typename type_traits::sig_UInt_for_UInt_t<Int_Type>;
01791                 using dig_t = dig_t<Int_Type,Base>;
01792                 using nat_reg_digs_t = nat_reg_digs_t<Int_Type,Base,Length>;
01794                 size_t  indice{0};
01796                 Int_Type                digito{0};
01797                 size_t longitud{0};
01798                 inttype                 numero_base_recogido{0};
01800                 nat_reg_digs_t& numero_ret{arg};
01802                 estado_e est_act = e0ini;
01804                 char c{'\0'};
01806                 is >> sds;
01808                 do {
01809                         c = sds[indice];
01810                         switch(est_act) {
01811                                 case e0ini :
01812                                         {
01813                                                 if (c=='r') {
01814                                                         est_act = e1r;
01815                                                 } else {
01816                                                         est_act = e0ini;
01817                                                 }
01818                                         }
01819                                         break;
01820                                 case e1r :
01821                                         {
01822                                                 {
01823                                                         if (c=='e') {
01824                                                                 est_act = e1e;
01825                                                         }
01826                                                         else {
01827                                                                 est_act = e0ini;
01828                                                         }
01829                                                 }
01830                                         }
01831                                         break;
01832                                 case e1e :
01833                                         {
01834                                                 if (c=='g') {
01835                                                         est_act = e1g;
01836                                                 }
01837                                                 else  {
01838                                                         est_act = e0ini;
01839                                                 }
01840                                         }
01841                                         break;
01842                                 case e1g :
01843                                         {
01844                                                 if (c=='_') {
01845                                                         est_act = e1sep;
01846                                                 }
01847                                                 else  {
01848                                                         est_act = e0ini;
01849                                                 }
01850                                         }
01851                                         break;
01852                                 case e1sep :
01853                                         {
01854                                                 if (c=='d') {
01855                                                         est_act = e1d;
01856                                                 }
01857                                                 else  {
01858                                                         est_act = e0ini;
01859                                                 }
01860                                         }
01861                                         break;
01862                                 case e1d :
01863                                         {
01864                                                 if (c=='i') {
01865                                                         est_act = e1i;
01866                                                 }
01867                                                 else  {
01868                                                         est_act = e0ini;
01869                                                 }
01870                                         }
01871                                         break;
01872                                 case e1i :
01873                                         {
01874                                                 if (c=='g') {
01875                                                         est_act = e2g;
01876                                                 }
01877                                                 else  {
01878                                                         est_act = e0ini;
01879                                                 }
01880                                         }
01881                                         break;
01882                                 case e2g :
01883                                         {
01884                                                 if (c=='#') {
01885                                                         est_act = e2start;
01886                                                 }
01887                                                 else  {
01888                                                         est_act = e0ini;
01889                                                 }
01890                                         }
01891                                         break;
01892                                 case e2start :
01893                                         {
01894                                                 if (((c>='0')&&(c<='9'))&&(std::abs(c-'0')<Base)) {
01895                                                         est_act = e2dig;
01896                                                         digito = (c-'0');
01897                                                         longitud = 0;
01898                                                         numero_base_recogido = 0;
01899                                                         numero_ret = nat_reg_digs_t::regd_0();
01900                                                 }
01901                                                 else  {
01902                                                         est_act = e0ini;
01903                                                         digito = 0;
01904                                                         longitud = 0;
01905                                                         numero_base_recogido = 0;
01906                                                         numero_ret = nat_reg_digs_t::regd_0();
01907                                                 }
01908                                         }
01909                                         break;
01910                                 case e2dig :
01911                                         {
01912                                                 const bool dig_c {(c >= '0') && (c <= '9')};
01913                                                 const bool dig_lt_Base{digito<Base};
01914                                                 const bool c_es_dig_B {dig_c && dig_lt_Base};
01915                                                 const bool dig_B_cdl {c_es_dig_B && (longitud < Length-1)};
01916                                                 const bool tt_dig_B_cdl {(c==':')&&dig_lt_Base&&(longitud < Length-1)};
01917                                                 const bool tf_dig_B_cdl {(c=='#')&&dig_lt_Base&&(longitud == Length-1)};
01918                                                 if (dig_B_cdl) {
01919                                                         digito *= 10;
01920                                                         digito += (c-'0');
01921                                                         est_act = e2dig;
01922                                                 }
01923                                                 else if (tt_dig_B_cdl) {
01924                                                         est_act = e2dp;
01925                                                 }
01926                                                 else if (tf_dig_B_cdl) {
01927                                                         est_act = e2end;
01928                                                 }
01929                                                 else  {
01930                                                         est_act = e0ini;
01931                                                         digito = 0;
01932                                                         longitud = 0;
01933                                                         numero_base_recogido = 0;
01934                                                         numero_ret = nat_reg_digs_t::regd_0();
01935                                                 }
01936                                         }
01937                                         break;
01938                                 case e2dp :
01939                                         {
01940                                                 const bool dig_c {(c >= '0') && (c <= '9')};
01941                                                 const bool c_es_dig_B {(std::abs(c-'0')<Base) && (digito<Base)};
01942                                                 const bool dig_B_cdl {dig_c && c_es_dig_B && (longitud < Length-1)};
01943                                                 const bool rdig_B_cdl {dig_c && c_es_dig_B && dig_B_cdl};
01944                                                 if (rdig_B_cdl) {
01945                                                         est_act = e2dig;
01946                                                         numero_ret[Length-1-longitud] = dig_t(digito);
01947                                                         ++longitud;
01948                                                         digito = c-'0';
01949                                                 }
01950                                                 else  {
01951                                                         est_act = e0ini;
01952                                                         digito = 0;
01953                                                         longitud = 0;
01954                                                         numero_base_recogido = 0;
01955                                                         indice = 0;
01956                                                         numero_ret = nat_reg_digs_t::regd_0();
01957                                                 }
01958                                         }
01959                                         break;
01960                                 case e2end :
01961                                         {
01962                                                 const bool c_es_sepfin {c == 'B'};
01963                                                 const bool d_es_digB {digito < Base};
01964                                                 const bool l_coincide {longitud == Length-1};// llega al cero ?
01965                                                 const bool rdigB_cdl {c_es_sepfin && d_es_digB && l_coincide};
01966                                                 if (rdigB_cdl) {
01967                                                         est_act = e2B;
01968                                                         numero_ret[Length-1-longitud] = dig_t(digito);
01969                                                         digito = 0;
01970                                                         longitud = 0;
01971                                                 }
01972                                                 else  {
01973                                                         est_act = e0ini;
01974                                                         indice = 0;
01975                                                         digito = 0;
01976                                                         longitud = 0;
01977                                                         numero_ret = nat_reg_digs_t::regd_0();
01978                                                 }
01979                                         }
01980                                         break;
01981                                 case e2B :
01982                                         {
01983                                                 if ((c >= '0')&&(c <= '9')) {
01984                                                         est_act = e3dig;
01985                                                         numero_base_recogido = c-'0';
01986                                                         digito = 0;
01987                                                 }
